import { Component } from 'react'
import { Select } from 'antd';

const { Option } = Select;

let selectGenerator = (title, inputName, options) => {
    return (<div className={'selectInput'}>
        <div className={'item'}><label>{title}</label></div>
        <div className={'item'}>
            <Select defaultValue="lucy" name={inputName} style={{ width: 120 }}>
                {options.maps(w=> <Option value={w.id}>{w.name}</Option>)}
            </Select>
        </div>
    </div>)
}

let holder = [
    {
        id: 5,
        name: "Baki"
    },
    {
        id: 4,
        name: "Kelbecer"
    }
]

class Filter extends Component {
    render(h) {
        return (
            <div className={'filter'}>
                <div className={'container'}>
                    {selectGenerator("Şəhər:", "city", )}
                </div>
            </div>
        )
    }

}


export default Filter;
